import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { LandingPageComponent } from './pages/landing-page/landing-page.component';
import { HeroImageComponent } from './hero/image/hero-image.component';
import { BackgroundComponent } from './basics/background/background.component';
import { CallToActionComponent } from './hero/call-to-action/call-to-action.component';
import { LoginResiterComponent } from './basics/login-resiter/login-resiter.component';

@NgModule({
  declarations: [
    AppComponent,
    LandingPageComponent,
    HeroImageComponent,
    BackgroundComponent,
    CallToActionComponent,
    LoginResiterComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
